              description="mydesc"
              imageurl="https://encrypted-tbn0.gstatic.com/licensed-image?q=tbn:ANd9GcTGMHb7W_WNUwFKDXmlFAC_JTRVLWdTRYddJ0VJ2PDRtURCFKJI2xZea2Y9jtKxM2HI335qzO2h0mG1Aaw"
            />
          </div>

          <div className="col-md-4">
            <NewsItem title="myTitle" description />
